  var names = ['Story Time for Kids', 'Camping with Turtles', 'Wildlife Warriors', 'Parrot Talk', 'Birds of Prey', 'Croco World', 'Venomous Snake Hunt', 'Face Painting & Drawing events', 'Pony Rides', 'Feed the Giants', 'Jungle Treasure Hunt', 'Endangered Species Program', 'Black Cockatoos Playtime', 'Walk with Jungle King', 'Trained Climbers', 'Playtime with Chimpanzees', 'Meet a small Mammal', 'Amazon Fish Feeding', 'Elephant Ride'];
  var dayCount = 1000 * 60 * 60;

  for (var a = start, id = 1; a < end; a += dayCount * 24 * 2) {
    var count = Math.floor(Math.random() * 9 + 1);

    for (var b = 0; b < count; b++) {
      var hour = Math.floor(Math.random() * 100) % 24;
      var minutes = Math.round(Math.floor(Math.random() * 100) % 60 / 5) * 5;
      var nCount = Math.floor(Math.random() * names.length);
      var startDate = new Date(new Date(a).setHours(hour, minutes));
      var endDate = new Date(startDate.getTime() + dayCount * 2.5);
      data.push({
        Id: id,
        Subject: names[nCount],
        StartTime: startDate,
        EndTime: endDate,
        IsAllDay: id % 10 ? false : true
      });
      id++;
    }
  }

  return data;
}
